import React, { Component } from "react";
import QuoteContainer from "./quote-container";

class Page extends Component {
  constructor(props) {
    super(props);
    this.state = {
      styles: {
        background: [
          Math.random() * 256,
          Math.random() * 256,
          Math.random() * 256
        ],
        width: "100vw",
        height: "100vh"
      }
    };
  }

  render() {
    return (
      <div style={this.state.styles}>
        <QuoteContainer color={this.state.styles.background} />
      </div>
    );
  }
}

export default Page;
